import React from 'react';
import ReactDOM from 'react-dom';
import App from './components/App';
import './styles/main.css';

// Load debug utilities in development mode only
if (window.NODE_ENV === 'development') {
  // Load user interest analysis for development
  import('./services/userInterestAnalysis');
}

ReactDOM.render(
  <React.StrictMode>
    <App />
  </React.StrictMode>,
  document.getElementById('root')
);
